import React from "react";
import ReactDOM from "react-dom";
import Cards from "./Cards";
import Sdata from "./SData";
import './index.css';

function nCard(val){

    return(    <Cards
        imgsrc={val.imgsrc}
        title={val.title}
        SName={val.SName}
        refrence={val.refrence}
        />
    );
}
ReactDOM.render(
    <>
    <h1>Most viewewd seasons in 2022</h1>
    {Sdata.map(nCard)}
        {console.log(val)}
    </>
    ,
    document.getElementById("root"));
